description:
Verenigde Staten
Horror / Komedie

geregisseerd door BJ McDonnell
met Danielle Harris, Kane Hodder en Zach Galligan

Marybeth probeert het ware geheim te vinden om een einde te maken aan de voodoovloek, die ervoor heeft gezorgd dat Victor Crowley jarenlang de moerassen van Honey Island heeft geterroriseerd. Ondertussen wordt een SWAT-team ingezet en naar het moeras gestuurd om het bloedbad in het spookachtige moeras te onderzoeken.



